styleUrlsData.data:
.checkbox-small {
  &::ng-deep {
    .mdc-checkbox {
      --mdc-checkbox-state-layer-size: 32px;
      padding: 7px !important;
      .mdc-checkbox__background {
        height: 14px;
        width: 14px;
        margin: 2px;
      }
    }
    .mdc-checkbox__ripple {
      height: 32px !important;
      width: 32px !important;
    }
  }
}

.checkbox-medium {
  &::ng-deep {
    .mdc-checkbox {
      padding: calc((var(--mdc-checkbox-state-layer-size, 45px) - 18px) / 2);
    }
    .mdc-checkbox__background {
      height: 18px !important;
      width: 18px !important;
    }
    .mdc-checkbox__ripple {
      height: 42px !important;
      width: 42px !important;
    }
  }
}

.color-primary {
  &::ng-deep {
    --mdc-checkbox-selected-focus-icon-color: #1e62a1 !important;
    --mdc-checkbox-selected-hover-icon-color: #1e62a1 !important;
    --mdc-checkbox-selected-icon-color: #1e62a1 !important;
    --mdc-checkbox-selected-pressed-icon-color: #1e62a1 !important;
    .mdc-checkbox__ripple {
      background-color: #1e62a1 !important;
    }
  }
}
.color-accent {
  &::ng-deep {
    --mdc-checkbox-selected-focus-icon-color: #0cbbe2 !important;
    --mdc-checkbox-selected-hover-icon-color: #0cbbe2 !important;
    --mdc-checkbox-selected-icon-color: #0cbbe2 !important;
    --mdc-checkbox-selected-pressed-icon-color: #0cbbe2 !important;
    .mdc-checkbox__ripple {
      background-color: #0cbbe2 !important;
    }
  }
}
.color-warn {
