.slider--small {
  height: 47px;
  &::ng-deep {
    .mdc-slider__thumb-knob {
      width: var(--mdc-slider-handle-width, 12px);
      height: var(--mdc-slider-handle-height, 12px);
      border-width: calc(var(--mdc-slider-handle-height, 12px) / 2)
        calc(var(--mdc-slider-handle-width, 12px) / 2);
    }
    .mat-mdc-slider-visual-thumb .mat-ripple {
      height: 28px !important;
      width: 28px !important;
      margin: 0.7142857142857143rem;
      border-radius: 14px;
    }
    .mdc-slider__track--inactive {
      height: var(--mdc-slider-inactive-track-height, 2px) !important;
    }
    .mdc-slider__track {
      --mdc-slider-inactive-track-height: 2px !important;
    }
    .mdc-slider__track--active {
      height: var(--mdc-slider-active-track-height, 4px);
      top: calc(
        (
            var(--mdc-slider-inactive-track-height, 4px) -
              var(--mdc-slider-active-track-height, 3px)
          ) / 2
      );
    }
  }
}
.slider--primary {
  &::ng-deep {
    .mdc-slider__track--inactive {
      background-color: #1e62a1;
      opacity: 0.24;
    }
    .mdc-slider__thumb-knob {
      border-color: #1e62a1 !important;
      background-color: #1e62a1 !important;
    }
    .mdc-slider__track--active_fill {
      border-color: #1e62a1 !important;
    }
